import React from "react";
import styled from 'styled-components';
import {Link} from "react-router-dom";
function DropMenu(props) {
    return(
    <>
    <div className="row text-center">
        <img src="static/images/Close.svg" onClick={props.toggling}></img>
        <Link to="/" className="col-12">HOME</Link>
        <div className="col-12">NOLEGGIO OFFERTE</div>
        <Link to="/Long_Rent_Benefits" className="col-12"><div>Lungo termine</div></Link>
        <Link to="/Short_Rent_Benefits" className="col-12"><div>Breve termine</div></Link>
        <Link to="/ri_noleggio" className="col-12">RI-NOLEGGIO</Link>
        <Link to="/vendo_compro_auto" className="col-12">VENDO COMPRO AUTO</Link>
        <Link to="/service" className="col-12">SERVICE</Link>
        <Link to="/contatti" className="col-12">CONTATTI</Link>
    </div>
    </>
    );
}
export default DropMenu;
